public class StandardERC20Deployment : StandardERC20DeploymentBase
{
    public StandardERC20Deployment() : base(BYTECODE) { }
    public StandardERC20Deployment(string byteCode) : base(byteCode) { }
}

public class StandardERC20DeploymentBase : ContractDeploymentMessage
{
    public static string BYTECODE = "";
    public StandardERC20DeploymentBase() : base(BYTECODE) { }
    public StandardERC20DeploymentBase(string byteCode) : base(byteCode) { }
    [Parameter("uint256", "initialSupply", 1)]
    public BigInteger InitialSupply { get; set; }
}

